import React, { useState } from "react";
import Container from "./UI/Container";

const users = [];

const RenderUser = (props) => {
  users.push(props);

  if (users.length <= 1) {
    return (
      <Container>
        <p>No entries found</p>
      </Container>
    );
  }
  console.log(users);
  return (
    <Container>
      {users.map((userData) => {
        <ul>
          <p>{userData.username}</p>;
        </ul>;
      })}
    </Container>
  );
};

export default RenderUser;
